import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, Animated, Easing } from 'react-native';
import { TextInput } from 'react-native-web';


const login = () => {
    return(
        <View style={stylesContainers.container}>
            <View style={stylesContainers.border}>
                <View style={{alignItems: 'center'}}>
                    <Text>Anmelden</Text>
                </View>
                <View>
                    <Text>Email</Text>
                    <View style={stylesContainers.inputt}>
                    <Text>IMG</Text>
                    <TextInput></TextInput>
                    </View>
                </View>
            </View>
        </View>
    );

};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "row",
        justifyContent: 'center',
        alignItems: 'center',
        width:500,
        height: 1000,
    },
    inputt:{
        flexDirection: "row",
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        marginRight: 3,
    },
    border:{
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        marginRight: 3,
    }

});
export default login;
